import logo from './logo.svg';
import './App.css';

const daneSklep =[{
  imgName: "img/gruszka.jpg",
  name: "Morela",
  opis: "Eko morela",
  stan: 2,
  cena: 2.80,
  naStanie: true,
},
{
  imgName: "img/gruszka.jpg",
  name: "Winogrona",
  opis: "Eko winogrona",
  stan: 10,
  cena: 7.80,
  naStanie: true,
}

]

function App() {
  return (
    <div className='goraLewa'>

      <h1>Internetowy sklep z eko-warzywami</h1>

    <div className='goraPrawa'>
      <ol>
        <li>Warzywa</li>
        <li>Owoce</li>
        <li>Soki</li>
      </ol>


    <div className='glowny'>
        <Box/>


    <div className='stopka'>


    </div></div></div></div>


  );
}

function Box(){
  return (

    <div className="Foto">
        <ItemList/>


    </div>

  );
};

function ItemList(props){
  console.log(props);

  return(

    <div className='data'>

      <img src={props.itemObj.imgName} alt={props.itemObj.name}></img>
      <h5>{props.itemObj.name}</h5>
      <p>{props.itemObj.opis}</p>
      <p>{props.itemObj.stan}</p>
      <h2>{props.itemObj.cena}</h2>

    </div>

  );

};

function Item(){

  const dane = daneSklep;
  const allItems = dane.length;

  return(
    <div>

      { allItems > 0 ? (
        dane.map((item)=>(
           <ItemList itemObj={item} key={item.name}/>
          ))
        ):(<p>Brak towaru</p>)
      }

    </div>
  );
};
export default App;
